import React from "react";
import { useUserList } from "./hooks/use-user-list/useUserList";
import styled from "styled-components";

const Ul = styled.ul`
  margin: 0;
  padding: 0;
`;

const UserList = () => {
  const userList = useUserList();
  return (
    <div>
      <Ul>
        {userList.map(({ name }, idx) => {
          return <li key={`${name}-${idx}`}>{name}</li>;
        })}
      </Ul>
    </div>
  );
};

export { UserList };
